import React, { useState } from 'react';
import { useParams, useLocation } from 'react-router-dom';
import './styles.css'; // CSS dosyasını dahil ediyoruz

const HalisahaDetails = () => {
  const { halisahaName } = useParams();
  const location = useLocation();
  const halisaha = location.state;

  const [reservations, setReservations] = useState([]);
  const [reservation, setReservation] = useState({
    day: '',
    time: '',
  });

  const weekDays = [
    { name: 'Pazartesi', value: 1 },
    { name: 'Salı', value: 2 },
    { name: 'Çarşamba', value: 3 },
    { name: 'Perşembe', value: 4 },
    { name: 'Cuma', value: 5 },
    { name: 'Cumartesi', value: 6 },
    { name: 'Pazar', value: 0 },
  ];

  const availableTimes = [
    '08:00', '09:00', '10:00', '11:00', '12:00',
    '13:00', '14:00', '15:00', '16:00', '17:00',
    '18:00', '19:00', '20:00', '21:00', '22:00',
  ];

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setReservation((prev) => ({ ...prev, [name]: value }));
  };

  const handleReservation = () => {
    if (reservation.day && reservation.time) {
      const selectedDay = weekDays.find((day) => day.value.toString() === reservation.day)?.name;
      const isDuplicate = reservations.some(
        (res) => res.day === selectedDay && res.time === reservation.time
      );

      if (isDuplicate) {
        alert('Bu gün ve saat için zaten bir rezervasyon yapılmış.');
        return;
      }

      const newReservation = {
        halisahaName,
        day: selectedDay,
        time: reservation.time,
      };

      setReservations((prev) => [...prev, newReservation]);
      alert(`Rezervasyonunuz alındı: ${newReservation.day} - ${newReservation.time}`);
    } else {
      alert('Lütfen bir gün ve saat seçiniz.');
    }
  };

  if (!halisaha) {
    return (
      <div className="container">
        <h1>Halı Saha Detayları</h1>
        <p className="alert">Halı saha bilgisi bulunamadı. Lütfen tekrar deneyiniz.</p>
      </div>
    );
  }

  return (
    <div className="container">
      <h1>{halisahaName}</h1>
      <p><strong>Konum:</strong> {halisaha.location}</p>
      <p><strong>Telefon:</strong> {halisaha.phone}</p>
      <p><strong>Fiyat:</strong> {halisaha.price}</p>

      <h2>Rezervasyon Yap</h2>
      <form>
        <label>
          Gün:
          <select
            name="day"
            value={reservation.day}
            onChange={handleInputChange}
          >
            <option value="">Gün seçin</option>
            {weekDays.map((day) => (
              <option key={day.value} value={day.value}>
                {day.name}
              </option>
            ))}
          </select>
        </label>

        <label>
          Saat:
          <select
            name="time"
            value={reservation.time}
            onChange={handleInputChange}
          >
            <option value="">Saat seçin</option>
            {availableTimes.map((time) => (
              <option key={time} value={time}>
                {time}
              </option>
            ))}
          </select>
        </label>

        <button type="button" onClick={handleReservation}>
          Rezervasyon Yap
        </button>
      </form>

      <h2>Rezervasyonlar</h2>
      <ul>
        {reservations.map((res, index) => (
          <li key={index}>
            <span>{res.day}</span> - {res.time}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default HalisahaDetails;
